import { ActionTypes } from "../contants/action-types"

const initialState = {
    stocks: [{
        id: 1,
        stokkod: "Langtest",
        stokadı: "İNGİLİZCE",
        miktar: 0,
        birim: "SAYFA",
        alışfiyat: 0,
        satışfiyat: 140,
        kdv: "%40",
        İskonto: 0      
    }]
}

export const stockReducer = (state, {type,payload}) => {

    switch (type) {
        case ActionTypes.SET_STOCKS:
            return state;
        default:
            return state;
    }
}
